import { useThemeProps } from "@mui/material"
import React from "react"


function Bug(props) {


    return (
        <div>
            <h1>{props.title}</h1>
            <h2>{props.priority}</h2>
            <p>{props.description}</p>
            <h2>{props.dateCreated}</h2>
            <h2>{props.status}</h2>
        </div>
    );
}

export default Bug;
